INSERT INTO "process_notes" VALUES(6,249,'Lithography process: 1)Spin on photoresist using the calculated spin speed. 2)Softbake and cool. 3)Align and expose to UV light. 4)Place in developing solution for calculated time, then rinse and dry.','2012-09-10 11:56:58',1,'anonymous');
INSERT INTO "process_notes" VALUES(7,249,'Multiple layers of photoresist can be used to increase film thickness. If the film thickness is greater than 15 um the spin speed will not be accurate. Spin speed must be calculated by individual layer thickness.  A softbake is required between layers.','2012-09-10 12:05:51',1,'anonymous');
